import React from 'react'
import Moment from 'moment'
import Form1 from 'react-bootstrap/Form'
import Button from 'react-bootstrap/Button'

class Form extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      laaneBelop: null,
      nominellRente: null,
      terminGebyr: null,
      utlopsDato: null,
      saldoDato: null,
      datoForsteInnbetaling: null,
    };
  }
  mySubmitHandler = (event) => {
    event.preventDefault()
    alert("You are submitting " + this.state.laaneBelop);
    let jsonObject =
    {
        laanebelop: this.state.laaneBelop,
        nominellRente: this.state.nominellRente,
        terminGebyr: this.state.terminGebyr,
        utlopsDato: Moment(this.state.utlopsDato).format('YYYY-MM-DD'),
        saldoDato: Moment(this.state.saldoDato).format('YYYY-MM-DD'),
        datoForsteInnbetaling: Moment(this.state.datoForsteInnbetaling).format('YYYY-MM-DD'),
        ukjentVerdi: "TERMINBELOP",
    }
    console.log(JSON.stringify(jsonObject))
  };
  myChangeHandler = (event) => {
    let nam = event.target.name;
    let val = event.target.value;
    this.setState({ [nam]: val });
  };
  render() {
    return (
      <form onSubmit={this.mySubmitHandler}>
        <h1>Hello {this.state.datoForsteInnbetaling}</h1>
        <div class="form-group">
            <label for="exampleInputEmail1">Email address</label>
            <input 
                type="number" 
                class="form-control" 
                name="laaneBelop"
                onChange={this.myChangeHandler}
            />
        </div>
        <input
          type="number"
          name="nominellRente"
          onChange={this.myChangeHandler}
        />
        <input
          type="number"
          name="terminGebyr"
          onChange={this.myChangeHandler}
        />
        <input 
            type="date" 
            name="utlopsDato" 
            onChange={this.myChangeHandler} />
        <input 
            type="date" 
            name="saldoDato" 
            onChange={this.myChangeHandler} />
        <input
          type="date"
          name="datoForsteInnbetaling"
          onChange={this.myChangeHandler}
        />
        <input 
            type="submit"
        />
      </form>

    );
  }
}

export default Form;
